import React from "react";
import Card from "./Card.js";


function CardList({cards}) {

    return(
       <>
       {cards.map((card) => {
        // console.log(card.link);
        <Card key={card.name} card={card}></Card>
       })}


       </>

    ) 


}

export default CardList;

